import * as React from 'react';
import Box from '@mui/material/Box';
import Stack from '@mui/material/Stack';
import Typography from '@mui/material/Typography';
import { PieChart } from '@mui/x-charts/PieChart';

const pieParams = { height: 200, margin: { right: 5 } };
const palette = ['red', 'blue', 'green'];

export default function ChartSecond() {
    return (
        <Stack className='chart d-flex align-items-center' direction="row" width="100%" textAlign="center" spacing={2}>
            <Box flexGrow={1}>
                <Typography>Default</Typography>
                <PieChart
                    series={[{ data: [{ value: 10 }, { value: 15 }, { value: 20 }] }]}
                    {...pieParams}
                />
            </Box>
            <Box flexGrow={1}>
                <Typography>Palette</Typography>
                <PieChart
                    colors={palette}
                    series={[{ data: [{ value: 10 }, { value: 15 }, { value: 20 }] }]}
                    {...pieParams}
                />
            </Box>
            <Box flexGrow={1}>
                <Typography>Item</Typography>
                <PieChart
                    series={[
                        { data: [{ value: 10, color: 'orange' }, { value: 15 }, { value: 20 }] },
                    ]}
                    {...pieParams}
                />
            </Box>
        </Stack>
    );
}
